  function deletehandler(event){
    
    props.onDelete(props.id)
    

}

    return (
      <li>
        
          <div >
            olduml  :{props.olduml}
          </div>
          <div >
            newuml  :{props.newuml}
            </div>
            <div className="delete-button">
                        <button  onClick={deletehandler}>delete</button>
                    </div>
            
       
      </li>
    );
  };
  export default UmlItem;
